script: |
  super -f text -I q17.spq | sort > q17.out

inputs:
  - name: q17.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT + 83 BETWEEN ( col0 + col2 + - + col1 * + col0 + col2 + - col1 - + CAST ( NULL AS INTEGER ) * 19 ) AND col0;
  - name: tab1

outputs:
  - name: q17.out
    data: |
      51	14	96
